import React, { FormHTMLAttributes } from 'react';
import { DataEntry } from '../../../types';

// Define the props type including FormHTMLAttributes and DataEntry
type props = FormHTMLAttributes<HTMLFormElement> & {
  DataEntry: DataEntry;
};

// Use the EntryProps type for the props of the Entry component
const Entry: React.FC<props> = ({ DataEntry, ...rest }) => {
  return (
    <div>
      <p>{DataEntry.message}</p>
      <p>{DataEntry.id}</p>
    </div>
  );
}

export default Entry;
